	private static int findY(int x, int z,World world) {
		for(int y = 60;y<100;y++){
			BlockPos pos = new BlockPos(x, y, z);
			Block block = world.getBlockState(pos).getBlock();
			if(block.equals(Blocks.grass)){
				return y+1;
			}
			 
		}
		return 0;
	}
